    [],nt"revision_timestamp": "2013-03-15T10:36:44.708757",nt"name": "spatial-vegetation-data-for-pictured-rocks-national-lakeshore-vegetation-mapping-project",nt"isopen":
    false,nt"url": null,nt"notes": "The geographic information system (GIS)
    format spatial data set of vegetation for Pictured Rocks National Lakeshore (PIRO)
    was created by the National Park Service (NPS) Vegetation Inventory Program (VIP).
    The PIRO covers an area of approximately 36,046 ha (89,072 acres). The map classification
    scheme used to create the vegetation data set is designed to represent local vegetation
    types at the finest level possible using the National Vegetation Classification
    (NVC) Standard (Vr 2). Physiognomic information was also recorded, including height
    (woody vegetation), canopy density, and coverage patterns. The vegetation data set
    was developed by interpreting aerial photographs collected in 2005 and extensive
    field surveys. Individuals who cooperated in this project include; USGS Center for
    Biological Informatics, NPS Biological Resources Management Division, USGS Upper
    Midwest Environmental Sciences Center, NPS Pictured Rocks National Lakeshore, and
    NatureServe. The vegetation data are distributed as an ESRI format file geodatabase,
    stored in Universal Transverse Mercator zone 16 mapping coordinates, North American
    Datum 1983.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
